import React from "react";
import Inventory from "../../Data/inventory.json";

export default function ProductList() {
  const styles = Inventory.map(({ images }) => images);
  styles.map(({ front }) => {
    return (
      <div>
        <img src={front.front} />
      </div>
    );
  });
}
